// Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <nav className="dashboard-sidebar">
        <ul>
          <li><Link to="/">Dashboard</Link></li>
          <li><Link to="/user-management">User Management</Link></li>
          <li><Link to="/system-monitoring">System Monitoring</Link></li>
          <li><Link to="/report-generation">Report Generation</Link></li>
          <li><Link to="/settings">Settings</Link></li>
          <li><Link to="/issue-resolution">Issue Resolution</Link></li>
          <li><Link to="/logout">Logout</Link></li>
        </ul>
      </nav>

      {/* Main Content */}
      <main className="dashboard-content">
        <h2>Welcome to the Admin Dashboard</h2>
        <p>Overview of system statistics and quick access to main functionalities.</p>

        {/* Quick Links */}
        <div className="quick-links">
          <h3>Quick Links</h3>
          <ul>
            <li><Link to="/admin/user-management">User Management</Link></li>
            <li><Link to="/admin/report-generation">Reports</Link></li>
            <li><Link to="/admin/settings">Settings</Link></li>
          </ul>
        </div>
      </main>
    </div>
  );
}

export default Dashboard;
